import React from "react";
import ReactDOM from "react-dom";
import "bootstrap/dist/css/bootstrap.css";
import "../FA Icons/css/all.min.css";
class SocialMediaIcon extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      listItem: ["twitter", "facebook", "instagram"],
    };
  }

  render() {
    const { listItem } = this.state;
    return (
      <div className="container text-right">
        <a class="btn-floating btn-lg btn-tw" type="button" role="button">
          <a href="www.facebook.com">
            <i class="fab fa-twitter text-dark small"></i>
          </a>
        </a>
        <a class="btn-floating btn-lg btn-tw" type="button" role="button">
          <i class="fab fa-facebook text-dark small"></i>
        </a>

        <a class="btn-floating btn-lg btn-tw" type="button" role="button">
          <i class="fab fa-instagram text-dark small"></i>
        </a>
      </div>
    );
  }
}

export default SocialMediaIcon;
